import React from "react";

class Tag extends React.Component {
  render() {
    return (
      <select class="ui dropdown">
        <option value="">Tags</option>
        <option value="2">Origin</option>
        <option value="1">Weight</option>
        <option value="0">Quantity</option>
      </select>
    );
  }
}

export default Tag;
